import React from 'react';


function Food({name, img}){
  console.log(name);
  return (
    <div>
      <h1>i like {name} </h1>
      <img src={img} alt={name}></img>
    </div>


  )

}


const foodILike = [
  {
    id : 1,
    name : "kimchi",
    image : "https://cdn.imweb.me/thumbnail/20200415/6b6e035658bac.png",
    rating : 5
  },
  {
    id : 2,
    name : "kimbab",
    image : "https://i.ytimg.com/vi/2G5SAC3UI3M/maxresdefault.jpg",
    rating : 3.8
  },
  {
    id : 3,
    name: "jajang",
    image : "https://recipe1.ezmember.co.kr/cache/recipe/2016/07/02/40c4f639ca973d9acccecdf7cbe0cbc41.jpg",
    rating : 4.6
  }
];

function App() {
  return (
    <div className="App">
      <h1 id="222">dohyun</h1>
      <span className="ddd">hyun</span>
      hello! react
      {foodILike.map(dish => (
        <Food 
        key = {dish.id}
        name={dish.name}
        img={dish.image}
         />
      ))}
    </div>
  );
}

export default App;
